import React from "react";
import DashboardIcon from "@mui/icons-material/Dashboard";
import PaymentsIcon from "@mui/icons-material/Payments";
import ContactSupportIcon from "@mui/icons-material/ContactSupport";
import AccountBoxIcon from "@mui/icons-material/AccountBox";
import GroupIcon from "@mui/icons-material/Group";
import LogoutIcon from "@mui/icons-material/Logout";

import { Container, Header } from "./styles";

const Dashboard = () => {
  return (
    <>
      <Header>
        <div className="iconArea"></div>
        <div className="headerInfo"></div>
      </Header>
      <Container>
        <div className="sideMenu">
          <div className="menuIcons">
            <div className="iconWrapper">
              <DashboardIcon className="icon" /> <p>Dashboard</p>
            </div>

            <div className="iconWrapper">
              <PaymentsIcon className="icon" /> <p>Pagamentos</p>
            </div>

            <div className="iconWrapper">
              <ContactSupportIcon className="icon" /> <p>Suporte</p>
            </div>

            <div className="iconWrapper">
              <AccountBoxIcon className="icon" /> <p>Minha Conta</p>
            </div>
            <div className="iconWrapper">
              <GroupIcon className="icon" />
              <p>Usu√°rios</p>
            </div>
          </div>

          <footer className="footerMenu"></footer>
        </div>
        <div className="containerContent">
          <LogoutIcon /> <p>Sair</p>
        </div>
      </Container>
    </>
  );
};

export default Dashboard;
